// {"label":"http://is5.mzstatic.com/image/thumb/Podcasts60/v4/66/87/88/66878801-61a3-5fec-ea2b-15267e7bad77/mza_7485566853908738973.jpg/55x55bb-85.jpg", "attributes":{"height":"55"}},
// {"label":"http://is1.mzstatic.com/image/thumb/Podcasts60/v4/66/87/88/66878801-61a3-5fec-ea2b-15267e7bad77/mza_7485566853908738973.jpg/60x60bb-85.jpg", "attributes":{"height":"60"}},
// {"label":"http://is3.mzstatic.com/image/thumb/Podcasts60/v4/66/87/88/66878801-61a3-5fec-ea2b-15267e7bad77/mza_7485566853908738973.jpg/170x170bb-85.jpg", "attributes":{"height":"170"}}], "summary":{"label":"“Why live an ordinary life, when you can live an extraordinary one?” Tony Robbins, the #1 Life and Business Strategist, has helped over 50 million people from 100 countries create real and lasting change in their lives. In this podcast, he shares proven strategies and tactics so you, too, can achieve massive results in your business, relationships, health and finances. \n\nIn addition to excerpts from his signature events and other exclusive, never-before-released audio content, Tony and his team also conduct deeply insightful interviews with the most prominent masterminds and experts on the global stage, including Charles Duhigg (Pulitzer Prize winner and New York Times best-selling author and columnist), Tom Bilyeu (CEO and founder of Quest Nutrition), and Peter Diamandis (founder and chairman of the X-Prize Foundation). \n\nOther guests include renowned thought leader in mind-body health, Deepak Chopra, the legendary basketball coach, John Wooden, and marketing expert and business consultant Jay Abraham. \n\nLaunched in April 2016, the Tony Robbins Podcast immediately leapt to #2 in all of iTunes, and consistently holds a top position in its category (Education). \n\nThe Tony Robbins podcast honors the immutable law of life: that 80% of success is psychology and 20% is mechanics. There will always be challenges and obstacles, but none are insurmountable; if you train yourself to focus on what you can control, achieve the right mindset and obtain the skills you need, you too can take your life to the next level and move from ordinary to “extraordinary.”\n\nThe Tony Robbins podcast is produced by Robbins Research International. \n\n\nMore about Tony Robbins:\n\nTony Robbins is an entrepreneur, best-selling author, philanthropist and the nation’s #1 Life and Business Strategist. A recognized authority on the psychology of leadership, negotiations and organizational turnaround, he has served as an advisor to leaders around the world for more than 38 years, including Fortune 500 CEOs, medical doctors, U.S. Presidents, entertainment legends and championship sports teams. \n\nAuthor of five internationally bestselling books, including the recent New York Times #1 best-seller “Money: Master the Game,” Mr. Robbins has empowered more than 50 million people from 100 countries through his audio, video and life training programs. He created the #1 personal and professional development program of all time, and more than 4 million people have attended his live seminars – world-class events such as Unleash the Power Within, Business Mastery, and Date with Destiny, which was featured in the 2016 Netflix documentary, “I Am Not Your Guru.”\n\nRobbins is the chairman of a holding company comprised of more than a dozen privately held businesses with combined sales exceeding $5 billion a year. He has been honored by Accenture as one of the “Top 50 Business Intellectuals in the World”; by Harvard Business Press as one of the “Top 200 Business Gurus”; and by American Express as one of the “Top Six Business Leaders in the World” to coach its entrepreneurial clients. Fortune Magazine called him “The CEO Whisperer” in its recent cover story, and soon after he was named one of the Top 100 Most Powerful People in Global Finance by Worth Magazine.\n\nAs a philanthropist, Tony Robbins feeds 4 million people per year in 56 countries. To honor those who helped his family during tough times, he has personally provided 59 million meals to people in the USA and in 2015 matched funds to feed 100 million people through his partnership with Feeding America. He has also initiated programs in more than 1,500 schools, 700 prisons and 50,000 service organizations and shelters. He provides fresh water to 100,000 people a day in India in order to fight the #1 killer of children in that country – waterborne diseases."}, "im:price":{"label":"Get", "attributes":{"amount":"0", "currency":"USD"}}, "im:contentType":{"attributes":{"term":"Podcast", "label":"Podcast"}}, "rights":{"label":"© Robbins Research International"}, "title":{"label":"The Tony Robbins Podcast - Tony Robbins"}, "link":{"attributes":{"rel":"alternate", "type":"text/html", "href":"https://itunes.apple.com/us/podcast/the-tony-robbins-podcast/id1098413063?mt=2&uo=2"}}, "id":{"label":"https://itunes.apple.com/us/podcast/the-tony-robbins-podcast/id1098413063?mt=2&uo=2", "attributes":{"im:id":"1098413063"}}, "im:artist":{"label":"Tony Robbins"}, "category":{"attributes":{"im:id":"1304", "term":"Education", "scheme":"https://itunes.apple.com/us/genre/podcasts-education/id1304?mt=2&uo=2", "label":"Education"}}, "im:releaseDate":{"label":"2016-07-24T21:57:00-07:00", "attributes":{"label":"July 24, 2016"}}},
